import React, {useState} from 'react';
import {useHistory} from 'react-router-dom';

const SignInForm = () => {

	let history = useHistory();
	const [username, setUsername] = useState("");
	const [pwd, setPwd] = useState("");

	const handleLogin = (e) => {
		e.preventDefault();
		var user = e.target.elements.username.value;
		var pwd = e.target.elements.pwd.value;
		console.log(user,pwd);
		history.push("/");
	}
	
	return(
		<div className="container center-block">
			<div className="row">
				<div className="col-sm-4">
				<form onSubmit={(e) => handleLogin(e)}>
				    <div className="form-group d-flex">
				      <label className="col-sm-3">Username:</label>
				      <input type="username" 
				      	className="form-control col-sm-9" 
				      	placeholder="Enter username" 
				      	name="username" 
				      	value={username}
				      	onChange={(e) => setUsername(e.target.value)}
				      	/>
				    </div>
				    <div className="form-group d-flex">
				      <label className="col-sm-3">Password:</label>
				      <input type="password" 
				      	className="form-control col-sm-9" 
				      	placeholder="Enter password" 
				      	value={pwd}
				      	onChange={(e) => setPwd(e.target.value)}
				      	/>
				    </div>
				   <button className="btn primary-color main-text text-transform" type="submit">Add Details</button>
				  </form>
				</div>
			</div>
		</div>
	);
	
}

export default SignInForm;
